                Math.round(color1[1] + (color2[1] - color1[1]) * progress),
                Math.round(color1[2] + (color2[2] - color1[2]) * progress)

            return chars[Math.floor(Math.random() * chars.length)];

                    if (char === '\n') {
                        finalFrame += '\n';
                    } else {
                        finalFrame += `<span class="ascii-char" style="color: rgb(${color[0]},${color[1]},${color[2]})">${char}</span>`;
                    }
                }
                asciiArt.innerHTML = finalFrame;
                return;
            }
            
            const progress = frame / totalFrames;
            asciiArt.innerHTML = createFrame(progress);
            frame++;
            requestAnimationFrame(animate);
        }
        
        // 开始动画
        animate();
